description:
The sweet and cute Alison Brie promoting Scream 4 on Jimmy Kimmel Live April 14 2011. She is wearing a wonderful green mini that shows off her cleavage so very well.
She plays Annie Edison on Community, and Trudy Campbell on Mad Men.

Note: There are a few video glitches. The video is not perfect. It is about 8/10.

